import { SWAP_CARD_BACK } from  '../constant/action-type';
import { SWAP_CARD_FRONT } from  '../constant/action-type';

export function swapCard(payload) {
    if(payload.id === 'dense'){
        return { type: SWAP_CARD_BACK, payload }
    }
    else{
        return {type:SWAP_CARD_FRONT,payload}
    }

  };
